import React, { useState } from 'react'
import './Addproject.css'
import Sidebar from './Sidebar'

function Addproject() {
  const [field, setfield] = useState([{ member: "" }])
  const[count,setcount] = useState(1)

  const handleadd = (event) => {
    event.preventDefault()
    setcount(count+1)
    setfield([...field, { member: "" }])
  }

  const handlevalue =(e,i)=>{
    const values = [...field];
    values[i][e.target.name] = e.target.value;
    setfield(values);
  }

  const handledelete = (index) => {
    const deletefield = [...field]
    deletefield.splice(index, 1)
    setfield(deletefield)

  }
  return (
    <div id="main">
      <Sidebar/>
    <div className='addproject'>
      <h4>Add Project</h4>
      <div className='addscro'>
      <form>
        <div className='pd'>
          <div><span>Project Code : </span><input type='text' name='project_code'></input></div>
          <div><span>Project Name : </span><input type='text' name='project_name'></input></div>
          <div>
            <span>Status : </span>
            <select name='status'>
              <option value=''>Select</option>
              <option value='Completed'>Completed</option>
              <option value='Pending'>Pending</option>
              <option value='Ongoing'>Ongoing</option>
              <option value='Upcoming'>Upcoming</option>
            </select>
            </div>
          <div><span>Starting Date : </span><input type='date' name='start_date'></input></div>
          <div><span>Ending Date : </span><input type='date' name='end_date'></input></div>
          <button onClick={handleadd} className='adb'>Add Members</button>
          {
            field.map((field, index) => {
              return (
                <div key={index}>
                  <span>Member {index + 1} : </span>
                  <input type='text' name='member' value={field.member} onChange={(e)=>{handlevalue(e,index)}}></input>
                  <button onClick={() => { handledelete(index) }}>Delete Member</button>
                </div>
              )
            })
          }
          <p>{JSON.stringify(field)}</p><p>{count}</p>
          <div><span>Description : </span><textarea rows={5} cols={60} name='description'></textarea></div>
        </div>
        <div className='addbutton'>
          <button type='submit' name='submit'>Submit</button>
          <button type='reset'>Reset</button>
        </div>
      </form>
      </div>
    </div> 
    </div>
  )
}

export default Addproject
